package com.example.frontend.Activity;

import androidx.appcompat.app.AppCompatActivity;
import androidx.appcompat.widget.Toolbar;

import android.os.Bundle;
import android.util.Log;
import android.view.View;
import android.widget.Button;
import android.widget.TextView;
import android.widget.Toast;

import com.example.frontend.Model.Patient;
import com.example.frontend.R;
import com.example.frontend.Service.ServiceBuilder;
import com.example.frontend.Service.UserRegService;

import java.util.Date;
import java.util.List;

import retrofit2.Call;
import retrofit2.Callback;
import retrofit2.Response;

public class SignUpActivity extends AppCompatActivity {
    private TextView toolbarTitle;
    private Button btnNext;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_sign_up);

        Toolbar toolbar = findViewById(R.id.toolbar);
        toolbarTitle = findViewById(R.id.toolbar_title);
        toolbarTitle.setText("Register");
        setSupportActionBar(toolbar);
        getSupportActionBar().setTitle(null);
        getSupportActionBar().setDisplayHomeAsUpEnabled(true);
        btnNext = findViewById(R.id.btn_next);
        System.out.println("Petuh");
        btnNext.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                registerPatient();

            }
        });
    }

    private void registerPatient(){
//        final Patient patient = new Patient("Dumitru","2000/10/10","andreiTest1@gmail.com","079862342","Otovasca","andreiTest1","pass21","");

        UserRegService userRegService = ServiceBuilder.buildService(UserRegService.class);
        Call<Patient> request = userRegService.registerPatient(
                "Dumitru",
                new Date(2003,7,20),
                "andreiTest16@gmail.com",
                "079862342",
                "Otovasca",
                "andreiTest7",
                "pass21",
                "");

        request.enqueue(new Callback<Patient>() {
            @Override
            public void onResponse(Call<Patient> request, Response<Patient> response) {

                String responseCode = "Response code: " + response.code();
                Toast.makeText(getApplicationContext(),responseCode,Toast.LENGTH_SHORT).show();
            }

            @Override
            public void onFailure(Call<Patient> request, Throwable t) {
                System.out.println(t.getMessage());
                Toast.makeText(getApplicationContext(),t.getMessage(),Toast.LENGTH_SHORT).show();
            }
        });
    }
}